// TagViewer.jsx
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TagView = () => {
  const [tags, setTags] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8082/tags/')
      .then(response => {
        setTags(response.data);
      })
      .catch(error => {
        console.error('Error fetching tags:', error);
      });
  }, []); // O segundo parâmetro [] garante que useEffect seja executado apenas uma vez durante a montagem do componente.

  return (
    <div className="my-8">
      <h2 className="text-2xl font-bold mb-4">Tags Cadastradas</h2>
      <ul className="list-disc pl-4">
        {tags.map(tag => (
          <li key={tag.id} className="text-lg">{tag.name}</li>
          // Certifique-se de ter um identificador único, como "id", para cada tag.
        ))}
      </ul>
    </div>
  );
};

export default TagView;
